CREATE TABLE results(
   result_id        INTEGER  NOT NULL PRIMARY KEY 
  ,constituency_id  VARCHAR(9) NOT NULL
  ,declaration_time VARCHAR(14) NOT NULL
  ,result           VARCHAR(200) NOT NULL
  ,first_party      VARCHAR(200) NOT NULL
  ,second_party     VARCHAR(200) NOT NULL
  ,electorate       INTEGER  NOT NULL
  ,valid_votes      INTEGER  NOT NULL
  ,invalid_votes    INTEGER  NOT NULL
  ,majority         INTEGER  NOT NULL
  ,con              INTEGER  NOT NULL
  ,lab              INTEGER  NOT NULL
  ,ld               INTEGER  NOT NULL
  ,ukip             INTEGER  NOT NULL
  ,green            INTEGER  NOT NULL
  ,snp              INTEGER  NOT NULL
  ,pc               INTEGER  NOT NULL
  ,dup              INTEGER  NOT NULL
  ,sf               INTEGER  NOT NULL
  ,sdlp             INTEGER  NOT NULL
  ,uup              INTEGER  NOT NULL
  ,alliance         INTEGER  NOT NULL
  ,other            INTEGER  NOT NULL
  ,other_winner     INTEGER  NOT NULL
);
